Yes, you can create a presale contract separate from the main contract for your Defi project to sell your tokens privately to early investors. Here's a step-by-step guide on how to do this:

1. Choose a smart contract platform: First, you need to choose a smart contract platform where you can create and deploy your presale contract. Some popular options include Ethereum, Binance Smart Chain (BSC), and Tron.

2. Define the presale contract: Your presale contract should have the following features:

- Token sale: The contract should define the token sale process, including the amount of tokens to be sold, the price per token, the number of tokens to be sold, and the duration of the presale.
- Token transfer: The contract should allow for the transfer of tokens between the presale and main contracts. This will be necessary for the early investors to purchase tokens before they can participate in the main token sale.
- Token transfer fees: You can include a token transfer fee in your presale contract to cover the costs associated with transferring tokens to early investors.
- Token distribution: The contract should determine the distribution of tokens among early investors based on their purchase order. This can be done using a priority-based mechanism, where the first order of purchase is given priority.
- Token lock-in: To prevent early investors from selling their tokens before the main token sale, you can include a token lock-in period. This period will allow the early investors to hold their tokens for a certain period of time, usually 60-90 days.
- Token governance: The contract should allow early investors to participate in token governance by voting on proposals related to the project, such as token allocation, governance rules, and project updates.

3. Create the presale contract: Once you have defined the above features, you can create the presale contract using a smart contract platform's programming language of your choice. Here's an example using Solidity:
```solidity
pragma solidity ^0.8.0;

contract TokenSale {
    struct Token {
        uint256 supply;
        uint256 price;
        uint256 quantity;
        uint256 lockIn;
        uint256 totalSupply;
    }

    mapping(address => Token) public tokens;

    uint256 public initialSupply;
    uint256 public maxSupply;

    uint256 public totalSupply;
    uint256 public lockedSupply;

    function createToken(uint256 _supply, uint256 _price, uint256 _quantity, uint256 _lockIn, uint256 _totalSupply) public {
        tokens[msg.sender] = Token(_supply, _price, _quantity, _lockIn, _totalSupply);
        lockedSupply += _lockIn;
        totalSupply += _totalSupply;
    }

    function transferTokens(address _from, address _to, uint256 _amount) public {
        require(msg.sender == _from || lockedSupply >= _amount, "Transfer tokens is not possible.");
        require(msg.sender == _to || lockedSupply < 0, "Transfer tokens is not possible.");
        tokens[_from].quantity -= _amount;
        tokens[_to].quantity += _amount;
        lockedSupply -= _amount;
        totalSupply -= _amount;
    }

    function lockTokens(address _from, address _to) public {
        require(msg.sender == _from || lockedSupply >= _to, "Lock tokens is not possible.");
        lockedSupply += _to;
        totalSupply += _to;
    }

    function unlockTokens(address _from, address _to) public {
        require(msg.sender == _from || lockedSupply >= _to, "Unlock tokens is not possible.");
        lockedSupply -= _to;
        totalSupply -= _to;
    }

    function transferLockTokens(address _from, address _to, uint256 _amount) public {
        require(msg.sender == _from || lockedSupply >= _amount, "Transfer lock tokens is not possible.");
        lockedSupply -= _amount;
        totalSupply -= _amount;
    }

    function transferTotalTokens(address _from, address _to, uint256 _amount) public {
        require(msg.sender == _from || lockedSupply >= _amount, "Transfer total tokens is not possible.");
        lockedSupply -= _amount;
        totalSupply -= _amount;
    }

    function totalSupply() public view returns (uint256) {
        return totalSupply;
    }

    function lockedSupply() public view returns (uint256) {
        return lockedSupply;
    }
}
