// Function to get the nearest character
function getNearestCharacter() {
    // Get the player's current position
    var playerPos = PlayerManager.instance.getPos();

    // Initialize variables to keep track of the nearest character and their distance
    var nearestChar = null;
    var nearestDistance = Infinity;

    // Loop through all characters in the game
    for (var i = 0; i < LuauCharacterManager.instance.numCharacters(); i++) {
        // Get the character's position
        var characterPos = LuauCharacterManager.instance.getCharacterPos(i);

        // Calculate the distance between the player and the character
        var distance = Math.sqrt(Math.pow(playerPos.x - characterPos.x, 2) + Math.pow(playerPos.y - characterPos.y, 2));

        // If the distance is less than the current nearest distance, update the nearest character and distance
        if (distance < nearestDistance) {
            nearestChar = LuauCharacterManager.instance.getCharacter(i);
            nearestDistance = distance;
        }
    }

    // Return the nearest character and distance
    return { character: nearestChar, distance: nearestDistance };
}
// Main function to teleport the player to the nearest character
function teleportToNearestCharacter() {
    // Get the player's current position
    var playerPos = PlayerManager.instance.getPos();

    // Get the nearest character from the game
    var nearestChar = getNearestCharacter();

    // Calculate the new player's position based on the character's position
    var newPos = playerPos + nearestChar.character.pos;

    // Teleport the player to the new position
    PlayerManager.instance.teleport(newPos);
}
// Call the teleportToNearestCharacter function when the game starts
game.start();
