```cpp
#include <iostream>
#include <string>
#include <markdown2html/markdown.hpp>

std::string markdownToHtml(const std::string& markdown) {
    // Parse the markdown string into a markdown2html::Markdown document
    markdown2html::Markdown markdown_doc;
    markdown_doc.Parse(markdown);

    // Extract the text from the markdown document
    std::string text = markdown_doc.Text();

    // Convert the text to html using the markdown2html::HtmlWriter
    markdown2html::HtmlWriter html_writer;
    html_writer.SetOutputString(text);

    // Generate the html string
    std::string html = html_writer.GetHtml();

    return html;
}
```

