function isPrime(num) {
    // Check if the number is less than 2
    if (num < 2) {
        return false;
    }

    // Check if the number is divisible by any number less than itself
    for (let i = 2; i < num; i++) {
        if (num % i === 0) {
            return false;
        }
    }

    // If the number is not divisible by any number less than itself, it is a prime number
    return true;
}

// Example usage
const numbers = [2, 3, 4, 5, 6];
console.log(isPrime(numbers));  // Output: true
```

In this function, we first check if the number is less than 2, as prime numbers are defined as greater than 1. If the number is less than 2, we return `false` because it cannot be a prime number.

Next, we loop through all the numbers from 2 to the number itself, checking if the number is divisible by any of them. If the number is divisible by any of the numbers, we return `false` because it is not a prime number.

If the loop completes without finding any divisors, the number is a prime number and we return `true`.

Finally, we use an example usage of the function by passing an array of numbers `[2, 3, 4, 5, 6]` to the `isPrime` function and printing the result to the console. The output of the function is `true`, indicating that the number 2 is a valid prime number.

